!function(e,n){const r=e.querySelectorAll(".news__item");(async function(){return fetch("../json/news.json").then(e=>e.json()).catch(e=>{console.error(e)}).then(e=>e)})().then(e=>{e.forEach((e,n)=>{r[n].querySelector(".news__image").src=e.imageUrl,r[n].querySelector(".news__heading").innerHTML=e.heading,r[n].querySelector(".news__paragraph").innerHTML=e.content,r[n].querySelector(".news__time").innerHTML="Date: "+e.date,r[n].querySelector(".news__comments").innerHTML="Comments: "+e.comments,r[n].querySelector(".news__item-wrapper").href=e.url})})}(document,window);